ERROR - 2018-02-14 17:13:55 --> Severity: Warning  --> XMLWrapper::setNodeValue(): unterminated entity reference  Bradshaw, 2016). In South Australia, the State Government recognised this need and provided 80 Graduate Certificate in Education (GCE) scholarships for teachers and leaders to increase their capacity for more effectively educating students with autism in mainstream schools. The year-long (part-time) post graduate level scholarship program was offered by Flinders University and involved a combination of university-based classes and on-site support. The thesis is the report of an interpretive case study which analysed secondary data generated from teachers action plans, outcomes of action plans and students reports to assess the outcomes of their participation in the GCE. The research examines how leaders and teachers participation in the GCE influenced outcomes for participating schools and students. The research identified multiple areas for teacher and school improvement to support the needs of students with autism in regular classrooms. For example, schools recognised the need to improve their processes for Individual Education Plan (IEP) development and data collection, teacher professional development (PD) and increased whole school awareness and social supports for students with autism. Overall, the research demonstrated that the GCE encouraged the implementation of practices and supports that promoted greater awareness of autism and inclusivity at both the individual and whole school level. /opt/www/flextra-sites/flextra.flinders/flex/application/libraries/xmlwrapper/Xmlwrapper.php 82
